import React from 'react';
import Header from '../../components/Main/Header'
import Footer from '../../components/Main/Footer'
import Navbar from '../../components/Main/NavBar';
// Favicons 
import '../Admin/Main/img/favicons/favicon.ico'
// Libs CSS
import '../assets/Admin/Main/libs/%40fancyapps/fancybox/dist/jquery.fancybox.min.css'
import '../assets/Admin/Main/libs/%40fortawesome/fontawesome-free/css/all.min.css'
import '../assets/Admin/Main/libs/flickity/dist/flickity.min.css'
import '../assets/Admin/Main/libs/highlightjs/styles/vs2015.css'
import '../Admin/Main/libs/simplebar/dist/simplebar.min.css'
import '../Admin/Main/libs/flickity-fade/flickity-fade.css'
import '../Admin/Main/fonts/feather/feather.css'
// Theme CSS
import '../Admin/Main/css/theme.min.css'


export default ({ children }) => {

    console.log('render Main')

    return (
        <div>
            <Header />
            <Navbar />
            <div className="content">
                {children}

            </div>
            <Footer />
        </div>
    )
}
